import "./DesignProcess.css";
import Ellipse1 from "./img/Ellipse 7.png";
import Ellipse2 from "./img/Ellipse 8.png";
import Ellipse3 from "./img/Ellipse 9.png";
import Ellipse4 from "./img/Ellipse 10.png";

function DesignProcess() {
  return (
    <div>
      <div className="sec3-container">
        <div className="sec3-heading">Design Process</div>
        <div className="sec3-para">
          Masterpieces are always crafted with undying <br />
          fpassion, a dash of craziness and a lot of discipline.
        </div>
        <div className="sec3-parent">
          <div className="sec3-child">
            <div>
              <img src={Ellipse1} />
            </div>
            <div> Branding</div>
          </div>
          <div className="sec3-child">kk</div>
          <div className="sec3-child">kk</div>
          <div className="sec3-child">kk</div>
        </div>
      </div>
    </div>
  );
}

export default DesignProcess;
